import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';


import HomePage from './HomePage';
import AboutPage from './AboutPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> {/* Use "element" prop to specify the component */}
        <Route path="/about" element={<AboutPage />} /> {/* Use "element" prop to specify the component */}
      </Routes>
    </Router>
  );
}

export default App;
